import { StyleSheet, Text, View } from 'react-native';
import React, { useEffect } from 'react';
import Plant from './Plant';
import { useState } from 'react';
import { getPlants, getUser } from '../utils/service';

const Hibernacle = (props) => {
  const [plants, setPlants] = useState([]);

  const getData = async () => {
    const data = await getUser(8);
    console.log('data', data.plantsArray);
    setPlants(data.plantsArray);
  };
  useEffect(() => {
    getData();
    console.log('fetching data');
  }, []);
  console.log('Hibernacle()');
  return (
    <View>
      <Text>User's Hibernacle</Text>
      <View>
        {plants.map((element) => (
          <Plant plant={element} Key={element.id} />
        ))}
      </View>
    </View>
  );
};

export default Hibernacle;

const styles = StyleSheet.create({});
